import React from 'react';

const NextPrevious = ({nexprev, nextButton}) => {
    const x = nexprev.next;
    console.log(nexprev.next);

    if (nexprev !== null) {
        return(
        <button onClick={nextButton}>Next</button>
        );
    } else {
        return (<p></p>);
    }
};

export default NextPrevious;
